import React from 'react'
import { Box, TextField, List, ListItem } from '@material-ui/core'

class VinList extends React.Component {
    constructor(props) {
        super(props);
        this.state =  {
            vin: '',
            vin_list: ''
        }
      }
    handleVinChange(e) {
        console.log(e)

    }
    render() {
        return (
            <>
                <TextField 
                    id='vin'
                    label='vin'
                    value={this.state.vin}
                    onChange={this.handleVinChange}
                />
                
                <Box>
                    <List>
                    { this.vin_list.map( (vin) => {
                        <ListItem>vin</ListItem>
                    })}

                    </List>
                    
                </Box>
            </>
        )
    }
    

}

export default VinList
